import React, { Component } from 'react'

class Todos extends Component {

    state = {
        todos: [
            {
                id: 0,
                title: 'Take out the trash',
                checked: false
            },
            {
                id: 1,
                title: 'Yankee with no brim',
                checked: false
            },
            {
                id: 2,
                title: 'Based on what?',
                checked: false
            },
        ]
    }


    render() {
        return (
            <div>
                <h1>Todo</h1>
            </div>
        );
    }
}

export default Todos;
